def get_delta(matrix, group_option):
    group_list = group_mappings[group_option]
    n = len(group_list) + 1  # +1 for 'a person'
    # Only consider group_list (exclude 'a person' at index 0)
    in_group = []
    out_group = []
    for i in range(1, n):
        for j in range(1, n):
            if np.isnan(matrix[i, j]):
                continue
            if check_in_group(group_option, i-1, j-1):
                in_group.append(matrix[i, j])
            else:
                out_group.append(matrix[i, j])
    delta = np.mean(in_group) - np.mean(out_group)
    return delta
